import IBody from "../interfaces/IBody";
import { SimpleEventDispatcher } from "strongly-typed-events";
import ICollision from "../interfaces/icollision";
import { BodyTypes } from "../enum/body_types";
import { b2Body, b2Vec2, b2World } from "box2d.package.ts";
import { GameObject } from "../../../../core/components/core/game_object";
import { Vector2 } from "../../../../utility/math_extended/vector2";
import { Mathf } from "../../../../utility/math_extended/mathf";


export class Box2DBody implements IBody {
  OnCollision: SimpleEventDispatcher<ICollision> = new SimpleEventDispatcher<ICollision>();
  public gameObject!: GameObject;
  private readonly _ID: number;
  private _bodyType: BodyTypes;
  private _b2Body: b2Body;

  public get ID() {
    return this._ID;
  }
  public get bodyType() {
    return this._bodyType;
  }
  public get b2Body() {
    return this._b2Body;
  }
  public get position(): Vector2 {
    let pos = this._b2Body.GetPosition();
    return new Vector2(pos.x, pos.y);
  }
  public set position(position: Vector2) {
    this._b2Body.SetPosition(new b2Vec2(position.x, position.y));
  }
  public get rotation(): number {
    return Mathf.radiansToDegrees(this._b2Body.GetAngle());
  }
  public set rotation(radians: number){
    this._b2Body.SetAngle(radians);
  }
  public set angularVelocity(value: number) {
    this._b2Body.SetAngularVelocity(value);
  }
  public get angularVelocity(): number {
    return this._b2Body.GetAngularVelocity();
  }
  public set linearVelocity(value: Vector2) {
    this._b2Body.SetLinearVelocity(value);
  }
  public get linearVelocity(): Vector2 {
    let currentVelocity = this._b2Body.GetLinearVelocity();
    return new Vector2(currentVelocity.x, currentVelocity.y);
  }
  public get drag(): number {
    return this._b2Body.GetLinearDamping();
  }
  public set drag(value: number) {
    this._b2Body.SetLinearDamping(value);
  }
  public get centerOfMass(): Vector2 {
    let centerOfMass = this._b2Body.GetWorldCenter();
    return new Vector2(centerOfMass.x, centerOfMass.y);
  }
  public get angularDrag(): number {
    return this._b2Body.GetAngularDamping();
  }
  public set angularDrag(value: number) {
    this._b2Body.SetAngularDamping(value);
  }
  public get mass(): number {
    return this._b2Body.GetMass();
  }

  constructor(body: b2Body, ID: number, bodyType: BodyTypes) {
    this._b2Body = body;
    this._b2Body.SetUserData(this);
    this._bodyType = bodyType;
    this._ID = ID;
  }

  addForce(force: Vector2): void {
    this.linearVelocity = this.linearVelocity.add(force);
  }

  addForceAtPosition(force: Vector2, position: Vector2): void {
    this._b2Body.ApplyForce(force, position);
  }

  addTorque(torque: number): void {
    this._b2Body.ApplyTorque(torque);
  }

  addExplosionForce(explosionForce: number, explosionPosition: Vector2, explosionRadius: number):void {
    let distance = explosionPosition.distance(this.position);
    if (distance > explosionRadius) return;
    let explosionVector = this.position.subtract(explosionPosition).scale(explosionForce);
    this._b2Body.ApplyForce(explosionVector, explosionPosition);
  }

  addRelativeForce(): void {
    throw new Error("Method not implemented.");
  }
  addRelativeTorque(): void {
    throw new Error("Method not implemented.");
  }

  public Destroy(world: b2World): void {
    world.DestroyBody(this._b2Body);
  }
}
